class Solution:
    def maximumGain(self, s: str, x: int, y: int) -> int:
        # Use a stack - more efficient algorithm.
        # Stacks are highly efficient for this problem. The append and pop
        # operations on stack are both of O(1) complexity.
        # The algorithm that performs string rebuilding inside a while loop
        # is highly inefficient as string rebuilding is an expensive operation.
        if x >= y:
            check1, check2 = 'ab', 'ba'
        else:
            check1, check2 = 'ba', 'ab'
        hsh = {'ab': x, 'ba': y}
        res = 0
        stack = list()
        for ch in s:
            if stack and stack[-1] + ch == check1:
                res += hsh[check1]
                stack.pop()
            else:
                stack.append(ch)
        s1 = ''.join(stack)
        stack = list()
        for ch in s1:
            if stack and stack[-1] + ch == check2:
                res += hsh[check2]
                stack.pop()
            else:
                stack.append(ch)
        return res
    def maximumGain_1(self, s: str, x: int, y: int) -> int:
        # This algorithm is inefficient for very long strings. It throws TLE for the
        # last test case. This code has string rebuilding inside a while loop, which
        # is highly inefficient as string rebuilding is an expensive operation. Each
        # string rebuild creates a new string, as strings are immutable in Python.
        def get_points(s, txt, points):
            while s.find(txt) != -1:
                i = s.find(txt)
                points += hsh[txt]
                s = s[:i] + s[i+2:]
            return s, points
        hsh = {'ab': x, 'ba': y}
        if x >= y:
            s1, points1 = get_points(s, 'ab', 0)
            _, res = get_points(s1, 'ba', points1)
        else:
            s1, points1 = get_points(s, 'ba', 0)
            _, res = get_points(s1, 'ab', points1)
        return res

# Main section
for s, x, y in [
                  ('cdbcbbaaabab', 4, 5),
                  ('aabbaaxybbaabb', 5, 4),
                  ('', 4160, 8507),
               ]:
    print(f's = {s}')
    print(f'x, y = {x}, {y}')
    sol = Solution()
    r = sol.maximumGain(s, x, y)
    print(f'r  = {r}')
    r1 = sol.maximumGain_1(s, x, y)
    print(f'r1 = {r1}')
    print('============================')







